  const FirstTenTracks = tracksArray.slice(0, 10);
  console.log(FirstTenTracks);
  return (
    <div className="search-reseult-container">
      <Helmet>
        <title>Search-Reseult - Deezer</title>
        <meta
          property="og:title"
          content="Search-Reseult"
        />
      </Helmet>
      <Navbar rootClassName="navbar-root-class-name1"></Navbar>
      {FirstTenTracks.map((track) => (
        <section className="search-reseult-section" key={track.id}>
          <span className="search-reseult-text">Search Results</span>
          <div className="search-reseult-container1">
            <div className="search-reseult-container2">
              <img
                alt="image"
                src="{track.album.cover_medium}"
                className="search-reseult-image"
              />
            </div>
            <ul className="list">
              <li className="search-reseult-li list-item">
                <span>{track.artist.name}</span>
              </li>
              <li className="list-item">
                <span className="search-reseult-text2">{track.title}</span>
              </li>
              <li className="list-item">
                <span className="search-reseult-text3">{track.duration}</span>
              </li>
            </ul>
          </div>
        </section>
      ))}
      <div>

      </div>
    </div>
  )
}

export default SearchResult
